import { CoordinateList } from '../CoordinateList';
import { NewitemList } from '../NewitemList';

export const Main = () => {
  return (
    <div>
      <div>
        <h1>NEWARRIVAL</h1>
        <NewitemList />
      </div>
      <div>
        <h1>STAFF COORDINATE</h1>
        <CoordinateList />
      </div>
      <div>
        <h2>instagram</h2>
        <p>フォローで入荷情報をチェック</p>
        <img src="./images/instaicon.png" />
      </div>
    </div>
  );
};
